import styles from "./Goal.module.css";
import FormControl from "../FormControl/FormControl";
const Goal = (props) => {
  return (
    <FormControl>
      <input
        className={styles.goal}
        type="text"
        disabled
        value={props.name + " (" + props.age + " years old)"}
      />
    </FormControl>
  );
};

export default Goal;
